import React from 'react';
import './App.css';
import AvatarCustomizer from './components/AvatarCustomizer';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>골든벨 아바타 커스터마이저</h1>
        <p>당신만의 아바타를 만들어 게임에 참여하세요!</p>
      </header>
      <main>
        <AvatarCustomizer />
      </main>
    </div>
  );
}

export default App;
